import React, { Component, Fragment } from 'react'





function TodoList() {
  return (
    <div>
      <div>
        <input />
        <button>Submit</button>
      </div>
      <ul>
        <li> Learning English </li>
        <li> Learning coding</li>
      </ul>
    </div>
  );
}

export default TodoList;
